import React from "react";

const PremiumFeaturesBox = ({ isPremium, onUpgradeClick }) => {
  const features = [
    "Therapeutic Games üéÆ",
    "Breathing Exercises üå¨Ô∏è",
    "AI Coach ü§ñ",
    "Sleep Companion üò¥",
    "Mood Reports üìä",
    "Exclusive Content üé®",
    "Priority Support ‚ö°",
    "Merch Discounts üõçÔ∏è",
  ];

  return (
    <div className="premium-features-box">
      <h2 className="features-title">
        {isPremium ? "üåü Premium Features" : "‚ú® Unlock Premium"}
      </h2>
      <ul className="features-list">
        {features.map((f, i) => (
          <li key={i}>{f}</li>
        ))}
      </ul>
      {!isPremium && (
        <button className="upgrade-btn" onClick={onUpgradeClick}>
          Upgrade Now
        </button>
      )}
    </div>
  );
};

export default PremiumFeaturesBox;
